// imports react
import React from 'react';
// imports github, linkedin, and youtube logo

// style object for html styling footer is fixed to bottom of the page regardless of what gets rendered
const styles = {
    footer: {
        position: 'fixed',
        left: '0',
        bottom: '0',
        width: '100%',
        backgroundColor: 'lightblue',
    }
};
// footer function to generate footer html
function Footer() {
    // returns footer html code
    return (
        <footer style={styles.footer} className='d-flex justify-content-center align-items-center'>
            <a href="mailto:joey.douek@gmail.com">
      <img src={gmail} alt="Joey Douek" height="100" width="100"></img>
      </a> 
      <a href="https://github.com/joeyblue27">
      <img src={github} alt="Joey Douek" height="100" width="100"></img>
      </a>
      <a href="https://www.linkedin.com/in/joey-douek-279908273">
      <img src={linkedin} alt="Joey Douek" height="100" width="100"></img>
      </a>
        </footer>
    );
};
// exports footer function
export default Footer;
